function Cart(props) {
    const { cartItems } = props;

    const cartItemsArray = Object.values(cartItems);
    console.log(cartItemsArray);

    return (
        <div>
        <h2>Cart Items</h2>
        {cartItemsArray.map((itemObject, index) => {
          const item = Object.values(itemObject);
          console.log(item);
          return (
            <div className="cart-item" key={index}>
              <p>{item.name}</p>
              <p>{item.price}</p>
              <p>{item.amount}</p>
            </div>
          );
        })}
      </div>
    );
  }

  export default Cart;
